import React from "react";
import { Container } from "./syles";
import income from "./income.svg"

export const Summary = () => {
  return (
    <Container>
      <header>
        <p>Entradas</p>
        <img src={ income } alt="Entradas" />
      </header>
    </Container>
  )
}
